import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import About from "./components/About"
import Contacts from "./components/Contacts"
import { Header, HeaderLi, HeaderLogo, HeaderUl } from "./home-components";
import Logo from "./icon/photo-logo.jpg";
import "./app.css"
import { Link } from "react-router-dom/cjs/react-router-dom.min";
function App() {
  return (
    <div>
      <Header>
        <HeaderLogo>
          <img src={Logo} alt="" style={{ width: "60px", height: "60px", borderRadius: "50%" }} />
          <h1 style={{ color: "#fff" }}>Ozodbek</h1>
        </HeaderLogo>
        <HeaderUl>
        <Link to="/about" style={{ textDecoration: 'none' }}><HeaderLi>Oбо мне</HeaderLi></Link>
          <HeaderLi>Изучал </HeaderLi>
          <HeaderLi>Портфолио </HeaderLi>
          <HeaderLi>Контакты </HeaderLi>
        </HeaderUl>
      </Header>
      <Router>
        <Route  path="/about" component={About} />
        <Route  path="/contacts" component={Contacts} />
      </Router>
    </div>
  );
}

export default App;
